ity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"335542","type":"CustomJS"},{"attributes":{},"id":"335259","type":"BasicTickFormatter"},{"attributes":{},"id":"335402","type":"LinearScale"},{"attributes":{"fill_alpha":0.2,"fill_color":"#ffffea","hatch_alpha":0.2,"line_alpha":0.2,"line_color":"#ffcb66","x":{"field":"index"},"y":{"field":"equity_dd"}},"id":"335235","type":"Patch"},{"attributes":{"data":{"datetime":{"__ndarray__":"AADAbXIrdkIAAIDTxCt2QgAAwAS8LHZCAACAag4tdkIAAEDQYC12QgAAADazLXZCAADAmwUudkIAAADN/C52QgAAwDJPL3ZCAACAmKEvdkIAAED+8y92QgAAAGRGMHZCAABAlT0xdkIAAAD7jzF2QgAAwGDiMXZCAACAxjQydkIAAEAshzJ2QgAAgF1+M3ZCAABAw9AzdkIAAAApIzR2QgAAwI51NHZCAACA9Mc0dkIAAMAlvzV2QgAAgIsRNnZCAABA8WM2dkIAAABXtjZ2QgAAwLwIN3ZCAAAA7v83dkIAAMBTUjh2QgAAgLmkOHZCAABAH/c4dkIAAACFSTl2QgAAAByTOnZCAADAgeU6dkIAAIDnNzt2QgAAQE2KO3ZCAACAfoE8dkIAAEDk0zx2QgAAAEomPXZCAADAr3g9dkIAAIAVyz12QgAAwEbCPnZCAACArBQ/dkIAAEASZz92QgAAAHi5P3ZCAADA3QtAdkIAAAAPA0F2QgAAwHR
